import React from "react";
// import PropTypes from "prop-types";
import StyledLogo from "./style.js";
import logo from "./citrus-logo.svg";


function Logo() {
    return <StyledLogo><img src={logo} alt="citrus" width="100%"/></StyledLogo>;
}

//  Logo.propTypes = {
